import React, { useState, useEffect } from 'react';

const ExerciseForm = ({ workoutId, exercise, onExerciseComplete, onExerciseBack }) => {
  const [reps, setReps] = useState('');
  const [weight, setWeight] = useState('');
  const [restTime, setRestTime] = useState('');
  const [completedSets, setCompletedSets] = useState([]);
  const [currentSetIndex, setCurrentSetIndex] = useState(0);
  const [completedExerciseId, setCompletedExerciseId] = useState(null);

  useEffect(() => {
    initializeExercise();
  }, [exercise]);

  const initializeExercise = async () => {
    try {
      const startTime = new Date().toISOString();
      const response = await fetch(`https://bwg36wqc6b.execute-api.us-east-1.amazonaws.com/dev/workouts/${workoutId}/exercises`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ exercise_id: exercise.exercise_id, start_time: startTime }),
      });

      const data = await response.json();
      setCompletedExerciseId(data.completedExerciseId);

      const setResponse = await fetch(`https://bwg36wqc6b.execute-api.us-east-1.amazonaws.com/dev/workouts/${workoutId}/exercises/${data.completedExerciseId}/sets`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ reps, weight, rest_time: restTime }),
      });

      const setData = await setResponse.json();
      setCompletedSets([setData.set]);
    } catch (error) {
      console.error('Error initializing exercise:', error);
    }
  };

  const saveSet = async () => {
    try {
      const setId = completedSets[currentSetIndex]?.completed_set_id || null;
      const method = setId ? 'PUT' : 'POST';
      const url = setId 
        ? `https://bwg36wqc6b.execute-api.us-east-1.amazonaws.com/dev/workouts/${workoutId}/exercises/${completedExerciseId}/sets/${setId}`
        : `https://bwg36wqc6b.execute-api.us-east-1.amazonaws.com/dev/workouts/${workoutId}/exercises/${completedExerciseId}/sets`;

      const response = await fetch(url, {
        method,
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ reps, weight, rest_time: restTime }),
      });

      const data = await response.json();
      const updatedSets = [...completedSets];
      if (setId) {
        updatedSets[currentSetIndex] = data.set;
      } else {
        updatedSets.push(data.set);
        setCurrentSetIndex(updatedSets.length - 1);
      }
      setCompletedSets(updatedSets);
    } catch (error) {
      console.error('Error saving set:', error);
    }
  };

  const handleNextSet = () => {
    saveSet();
    setReps('');
    setWeight('');
    setRestTime('');
    if (currentSetIndex < completedSets.length - 1) {
      setCurrentSetIndex(currentSetIndex + 1);
    } else {
      setCompletedSets([...completedSets, { reps: '', weight: '', rest_time: '' }]);
    }
  };

  const handlePreviousSet = () => {
    saveSet();
    if (currentSetIndex > 0) {
      setCurrentSetIndex(currentSetIndex - 1);
      const previousSet = completedSets[currentSetIndex - 1];
      setReps(previousSet.reps);
      setWeight(previousSet.weight);
      setRestTime(previousSet.rest_time);
    }
  };

  const handleCompleteExercise = () => {
    saveSet();
    onExerciseComplete();
  };

  const handleBackExercise = () => {
    saveSet();
    onExerciseBack();
  };

  return (
    <div>
      <h2>{exercise.name}</h2>
      <p>{exercise.description}</p>
      <div>
        <label>Set {currentSetIndex + 1}</label>
        <div>
          <label>Reps:</label>
          <input
            type="number"
            value={reps}
            onChange={(e) => setReps(e.target.value)}
          />
        </div>
        <div>
          <label>Weight:</label>
          <input
            type="number"
            value={weight}
            onChange={(e) => setWeight(e.target.value)}
          />
        </div>
        <div>
          <label>Rest Time:</label>
          <input
            type="number"
            value={restTime}
            onChange={(e) => setRestTime(e.target.value)}
          />
        </div>
      </div>
      <div style={{ display: 'flex', justifyContent: 'space-between' }}>
        <button onClick={handlePreviousSet}>Previous Set</button>
        <button onClick={handleNextSet}>Next Set</button>
      </div>
      <div style={{ display: 'flex', justifyContent: 'space-between', marginTop: '10px' }}>
        <button onClick={handleBackExercise}>Previous Exercise</button>
        <button onClick={handleCompleteExercise}>Next Exercise</button>
      </div>
      <div>
        <h3>Completed Sets:</h3>
        <ul>
          {completedSets.map((set, index) => (
            <li key={index}>Set {index + 1}: {set.reps} reps, {set.weight} lbs, {set.rest_time} sec rest</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default ExerciseForm;
